import React, {createElement as CE} from 'react';
import { Collapse, Navbar, NavbarToggler, NavbarBrand, Nav, NavItem, NavLink, Container, Row, Col, Button } from 'reactstrap';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {
  return (
      <div>
        <Navbar color="inverse" light expand="md">
          <NavbarBrand href="/">reactstrap</NavbarBrand> 
          <NavbarToggler  />
          <Collapse isOpen={this.state.isOpen} navbar>
            <Nav className="ml-auto" navbar>
              <NavItem>
                <NavLink href="/components/">Components</NavLink>      
              </NavItem>
              <NavItem>
                <NavLink href="https://github.com/reactstrap
                /reactstrap">Github</NavLink>
              </NavItem>
            </Nav>
          </Collapse>
        </Navbar>
          <Container>
            <Row>
              <Col>
                <h1>Welcome to React</h1>
                <p><Button tag="a" color="success" size="large" 
                    href="http://reactstrap.github.io" 
                    target="_blank">View Reactstrap 
                    Docs</Button></p>
              </Col>
            </Row>
          </Container>
      </div>
  );

  // return(
  //   <button color='danger'>Sign in</button>
  //   )
  // return CE('div', {className: 'container'}, [
  //   CE('h1', {className: 'font-bold'}, 'Show jsx'), 
  //   CE('button', {className: 'primary'}, 'Buy')
  // ]);
}

export default App;
